        //     }
        // }
        console.log('updated');
        console.log(first);
        console.log(second);
        console.log(third);
        console.log(home);

    }


    useEffect(()=>{
        console.log(instance);
        setFirst(home[0]);
        setSecond(home[0]);
        setThird(home[0]);

        getStars();

    }, [])

    return (
        <div className="point-leaders">
            <div className="point-leader-card">
                <h1>{first.fn[0]}.{first.ln}</h1>
                <p>{first.pts}</p>
                <p>{first.ast}</p>
            </div>

            <div className="point-leader-card">
                <h2>{second.fn[0]}.{second.ln}</h2>
                <p>{second.pts}</p>
                <p>{second.ast}</p>
            </div>

            <div className="point-leader-card">
                <h3>{third.fn[0]}.{third.ln}</h3>
                <p>{third.pts}</p>
            </div>
        </div>
    );
}

export default PointLeaders;
